description:
We are in need of humans with above average skill levels to guide the ball through complicated mazes and sneak past dangerous obstacles.

Unlock new levels with achievement points which are earnt by completing levels within time boundaries , movement restrictions and if you dare, complete the levels in EXTREME MODE to score even more achievement points.

Challenge your hand eye coordination skills and push your mind to the limits, do you have what it takes?

